(6, 6, 'FAQ', '<p style=\"margin: 0.5em 0px; line-height: inherit; color: rgb(34, 34, 34); font-family: sans-serif;\">An&nbsp;<b>FAQ</b>&nbsp;is a list of frequently asked questions (FAQs) and answers on a particular topic (also known as Questions and Answers [Q&amp;A] or Frequently Answered Questions). The format is often used in articles, websites,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Electronic_mailing_list\" title=\"Electronic mailing list\" style=\"color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">email lists</a>, and online forums where common questions tend to recur, for example through posts or queries by new users related to common knowledge gaps. The purpose of an FAQ is generally to provide information on frequent questions or concerns; however, the format is a useful means of organizing information, and text consisting of questions and their answers may thus be called an FAQ regardless of whether the questions are actually&nbsp;<i>frequently</i>&nbsp;asked<sup id=\"cite_ref-faqsaboutfaqs_1-0\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 11.2px;\"><a href=\"https://en.wikipedia.org/wiki/FAQ#cite_note-faqsaboutfaqs-1\" style=\"color: rgb(11, 0, 128); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">[1]</a></sup>.</p>', '2019-08-13 13:28:14', '2019-07-16 14:33:34');

